import {Link} from 'react-router-dom';

export default function Home() {
  return (
    <>
     <h1>Home</h1>
     <ul>
        <li><Link to='/eventPage'>Event Page</Link></li>
        <li><Link to='/eventDetailPage'>Event Detail Page</Link></li>
        <li><Link to='/event/new'>New Event Page</Link></li>
        <li><Link to='/editEventPage'>Edit Event Page</Link></li>
     </ul>
    </>
  )
}
